import { AboutComponent } from '../AboutComponent/index'

interface Props {
  name: string
}

interface State {
  count: number
  developerName: string
}

export class LandingComponent extends React.Component<{}, State> {

  constructor(props: {}) {
    super(props)
  }

  render() {
    return (
      <>
      <MenuComponent />
      <AboutComponent />
      <Grid>
      </Grid>
      </>
    )
  }
}
